    /**
     * 滑块法相对于方法 lengthOfLongestSubstring_20190514_18_53有进步  但是依然耗费了大量时间和空间
     */
    public int lengthOfLongestSubstring(String s) {
        List<String> list = new ArrayList<>();
        for (int i = 0; i < s.length(); i++) {
            list.add(s.charAt(i)+"");
            singleString2(list);
        }
        return list.size();
    }


    private void singleString2(List<String> list) {
        boolean flag=true;
        Set<String> set = new HashSet<>();
        for (int i = 0; i < list.size(); i++) {
            String s1 = list.get(i);
            if(set.contains(s1)){
                flag = false;
            }else{
                set.add(s1);
            }
        }
        if(flag!=true){
            list.remove(0);
        }
    }


    /**
     * 该方法在leetcode执行到最后一个测试的时候出现超时
     */
    public int lengthOfLongestSubstring_20190514_19_25(String s) {
        int result = 0;
        for (int i = s.length(); i >= 0; i--) {
            for (int j = 0; j <= s.length()-i; j++) {
                String temp=s.substring(j,j+i);
                if(singleString(temp)){
                    return temp.length();
                }
            }
        }
        return result;
    }

    private boolean singleString(String s) {
        Set<String> set = new HashSet<>();
        for (int i = 0; i < s.length(); i++) {
            String s1 = s.charAt(i) + "";
            if(set.contains(s1)){
                return false;
            }else{
                set.add(s1);
            }
        }
        return true;
    }


    /**
     * 这个方法太丑陋了。。。但是通过了
     * 遍历
     * @param s
     * @return
     */
    public int lengthOfLongestSubstring_20190514_18_53(String s) {
        int length = s.length();
        Set<String> set = new HashSet<>();
        set.addAll(Arrays.asList(s.split("")));
        if (length == 0) {
            return 0;
        } else if (set.size() == 1) {
            return 1;
        } else if (set.size() == length) {
            return length;
        } else {
            set.clear();
        }
        int result = 0;
        int i = 0;
        while (i < s.length() && result < s.length()) {
            String s1 = s.charAt(i) + "";
            if (set.contains(s1)) {
                int size = set.size();
                result = size > result ? size : result;
                set.clear();
                s = s.substring(1);
                i = 0;
            } else {
                set.add(s1);
                int size = set.size();
                if (size == s.length()) {
                    result = size > result ? size : result;
                }
                i++;
            }
        }
        return result == 0 ? length : result;
    }


